import React from "react";

/**Import core component (variable)*/
import Select from "../../core/Select";
import { TOP_100_FILMS } from "./films";

export const DEMO = ({ view, color, dense }) => {
  return (
    <Select
      type={dense ? "dense" : "dafault"}
      view={view}
      color={color}
      dense={dense}
      items={TOP_100_FILMS}
      filterable={true}
      disabled={false}
    />
  );
};
